--
-- Name: v_projects; Type: VIEW; Schema: test2; Owner: -
--

CREATE VIEW test2.v_projects AS
 SELECT "current_schema"() AS tenant,
    'project'::character varying AS type,
    p.id AS type_id,
    p.title AS description,
    NULL::integer AS parent_id,
    NULL::character varying AS parent_description,
    NULL::integer AS grand_parent_id,
    NULL::character varying AS grand_parent_description,
    timezone('Europe/Amsterdam'::text, p.campaign_ended) AS "timestamp",
    (pp.slug)::character varying(20) AS status,
    (concat(pp.id, ' - ', pp.slug))::character varying(80) AS status_friendly,
    timezone('Europe/Amsterdam'::text, pl.start) AS event_timestamp,
    (plp.slug)::character varying(20) AS event_status,
    p.owner_id AS user_id,
    m.email AS user_email,
    m.remote_id AS user_remote_id,
    date_part('year'::text, timezone('Europe/Amsterdam'::text, pl.start)) AS year,
    date_part('quarter'::text, timezone('Europe/Amsterdam'::text, pl.start)) AS quarter,
    date_part('month'::text, timezone('Europe/Amsterdam'::text, pl.start)) AS month,
    date_part('week'::text, timezone('Europe/Amsterdam'::text, pl.start)) AS week,
    l.name AS location,
    lg.name AS location_group,
    1 AS value,
    NULL::integer AS value_alt
   FROM ((((((test2.projects_project p
     LEFT JOIN test2.projects_projectphaselog pl ON ((pl.project_id = p.id)))
     LEFT JOIN test2.members_member m ON ((m.id = p.owner_id)))
     LEFT JOIN test2.bb_projects_projectphase plp ON ((plp.id = pl.status_id)))
     LEFT JOIN test2.bb_projects_projectphase pp ON ((pp.id = p.status_id)))
     LEFT JOIN test2.geo_location l ON ((p.location_id = l.id)))
     LEFT JOIN test2.geo_locationgroup lg ON ((l.group_id = lg.id)));


--
-- Name: v_tasks; Type: VIEW; Schema: test2; Owner: -
--

CREATE VIEW test2.v_tasks AS
 SELECT "current_schema"() AS tenant,
    'task'::character varying AS type,
    t.id AS type_id,
    t.title AS description,
    t.project_id AS parent_id,
    p.description AS parent_description,
    NULL::integer AS grand_parent_id,
    NULL::character varying AS grand_parent_description,
    timezone('Europe/Amsterdam'::text, t.deadline) AS "timestamp",
    t.status,
    (initcap((t.status)::text))::character varying(80) AS status_friendly,
    timezone('Europe/Amsterdam'::text, tl.start) AS event_timestamp,
    tl.status AS event_status,
    t.author_id AS user_id,
    m.email AS user_email,
    m.remote_id AS user_remote_id,
    date_part('year'::text, timezone('Europe/Amsterdam'::text, t.deadline)) AS year,
    date_part('quarter'::text, timezone('Europe/Amsterdam'::text, t.deadline)) AS quarter,
    date_part('month'::text, timezone('Europe/Amsterdam'::text, t.deadline)) AS month,
    date_part('week'::text, timezone('Europe/Amsterdam'::text, t.deadline)) AS week,
    p.location,
    p.location_group,
    1 AS value,
    (t.time_needed)::integer AS value_alt
   FROM (((test2.tasks_task t
     LEFT JOIN test2.tasks_taskstatuslog tl ON ((tl.task_id = t.id)))
     LEFT JOIN test2.v_projects p ON ((p.type_id = t.project_id)))
     LEFT JOIN test2.members_member m ON ((m.id = t.author_id)));


--
-- Name: v_taskmembers; Type: VIEW; Schema: test2; Owner: -
--

CREATE VIEW test2.v_taskmembers AS
 SELECT "current_schema"() AS tenant,
    'taskmember_hours'::character varying AS type,
    tm.id AS type_id,
    t.description,
    t.type_id AS parent_id,
    t.description AS parent_description,
    t.parent_id AS grand_parent_id,
    t.parent_description AS grand_parent_description,
    timezone('Europe/Amsterdam'::text, t."timestamp") AS "timestamp",
    tm.status,
    (initcap((tm.status)::text))::character varying(80) AS status_friendly,
    timezone('Europe/Amsterdam'::text, tml.start) AS event_timestamp,
    tml.status AS event_status,
    tm.member_id AS user_id,
    m.email AS user_email,
    m.remote_id AS user_remote_id,
    date_part('year'::text, timezone('Europe/Amsterdam'::text, t."timestamp")) AS year,
    date_part('quarter'::text, timezone('Europe/Amsterdam'::text, t."timestamp")) AS quarter,
    date_part('month'::text, timezone('Europe/Amsterdam'::text, t."timestamp")) AS month,
    date_part('week'::text, timezone('Europe/Amsterdam'::text, t."timestamp")) AS week,
    t.location,
    t.location_group,
    (tm.time_spent)::integer AS value,
    t.value_alt
   FROM (((test2.tasks_taskmember tm
     LEFT JOIN test2.tasks_taskmemberstatuslog tml ON ((tml.task_member_id = tm.id)))
     LEFT JOIN ( SELECT DISTINCT ON (v_tasks.type_id) v_tasks.type_id AS task_type_id,
            v_tasks.tenant,
