            v_tasks.week,
            v_tasks.location,
            v_tasks.location_group,
            v_tasks.value,
            v_tasks.value_alt
           FROM test2.v_tasks) t ON ((t.task_type_id = tm.task_id)))
     LEFT JOIN test2.members_member m ON ((m.id = tm.member_id)));


